webpackJsonp([0xc872e0faa2d5],{5392:function(e,t){e.exports={data:{post:{html:'<p>Not all dot.coms are bombing. My employer just posted a 3rd quarter profit of 2000 Euros. Good thing no one raided the petty cash, we could have ended up with a loss! ";->" On the other hand, one of our main competitors just declared itself insolvent.</p>\n<p>Dave has written a press release proclaiming that <a href="http://www.userland.com/stories/storyReader$136">SOAP 1.1 and<br />\nXML-RPC work with 802.11b</a>. What I\'d really like to know is whether<br />\nthey work with another wireless protocol, namely <a href="http://www.blug.linux.no/rfc1149/">CPIP as per RFC 1149</a> <i>CPIP = Carrier Pigeon Internet Protocol</i> ";->"</p>',fields:{title:"Ray of Light",date:"26 Nov 2001",url:"https://papascott.de/2001-11-26-ray-of-light/"}}},pathContext:{slug:"/2001-11-26-ray-of-light/",prev:{fields:{title:"When You Were Mine",date:"25 Nov 2001",slug:"/2001-11-25-when-you-were-mine/"}},next:{fields:{title:"Naptime",date:"28 Nov 2001",slug:"/2001-11-28-naptime/"}}}}}});
